  input: '"TEXT","F3XA","","Mrs. Melissa Meyer, Campaign Finance Analyst, Reports
    Analysis Division. Federal Election Commission ID #C00412643. Reference Year End
    Report (11/28/2006 ? 12/31/06).     Dear Mrs. Meyer,     This letter is in response
    to your preliminary review of the Unite Our States (Committee) Year End Report.
    The review of that report identified the following: The total listed on lines
    21(b), 21(c) and 29, Column B of the Summary Page(s) appear to be incorrect.  The
    totals on Lines 11(a)(i) and 11(a)(ii), Column B of the Detailed Summary Page
    appear to be incorrect. The review also asked the Committee to clarify the purpose
    of disbursements described as ''Political Consulting Fees'', to clarify whether
    or not the disbursement described as ''Food and Service for Fundraiser'' was made
    on behalf of specifically identified federal candidates, and to clarify whether
    or not disbursements described as ''Broadcast Fax of Event Invitation'' and ''Media
    Consulting Services'' were for public communications or voter drive activity containing
    express advocacy.    The Committee amended its Year End Report on 3/12/2007 to
    reflect the correct totals for Lines 21(b), 21(c) and 29 Column B of the Summary
    Page(s). The totals for Lines 11(a)(i) and 11(a)(ii), Column B of the Detailed
    Summary Page were also corrected in the 3/12/2007 amendment.    The disbursements
    described as ''Political Consulting Fees'' have been clarified to reflect the
    services provided to the committee by the relative consultant.     The expenditure
    for Food and Service for Fundraiser'' on Schedule B, was for a PAC fundraiser
    and was not made on behalf of a specifically identified federal candidate.  The
    description has been amended to ''Food and Service for PAC Fundraiser''.    The
    expenditures for ''Broadcast Fax of Event Invitation'' and ''Media Consulting
    Services'' were not for public communications or voter drive activity containing
    express advocacy.  The Broadcast Fax was for a PAC fundraiser and the description
    has been amended to ''Broadcast Fax Invitation of PAC Event''.  The disbursement
    for ''Media Consulting Services'' was for content for the Unite Our States web
    site and was not for public communications or voter drive activity containing
    express advocacy. The description has been amended to ''PAC Media Consulting Services''.      Thank
    you.  ",""'
